import React from 'react';

import style from './Style.css';
import Card from './Card';

class ProblemLevel extends React.Component {
    render(){
        return(
            <div className="section">
            <div className="hero">
                <div className="cont">
                    <h1>Practice More And Level up Fast</h1>
                    <p>Learn Data Structures and Algorithms from basic to advanced level

                    </p>

                </div>
            </div>
            <div className="cards">
                <Card value={'Arrays'} title={'Array'} description={'Basic level Data Structures and Algorithms'}/>
                <Card value={'Stacks'} title={'Stack'} description={'Intermediate level Data Structures and Algorithms'}/>
                <Card value={'Linked List'} title={'Linked List'} description={'Advance level Data Structures and Algorithms'}/>
                <Card value={'Trees'} title={'Trees'} description={'Advance level Data Structures and Algorithms'}/>
                <Card value={'Graphs'} title={'Graphs'} description={'Advance level Data Structures and Algorithms'}/>
            </div>
            </div>
        )
    }
}

export default ProblemLevel;
